import React from 'react'
import { ListGroup, ListGroupItem } from 'reactstrap';

export default function Pokemons({pokemon}) {
    return (
        
        <ListGroup>
            {pokemon.map(p=>(
                <ListGroup.Item key={p}>{p}</ListGroup.Item>
            ))}
            <ListGroup.Item>Cras justo odio</ListGroup.Item>
            
        </ListGroup>
    )
}
<div>
            {pokemon.map(p=>(
                <div key={p}>{p}</div>
            ))}
        </div>
